Hi :)

I found in JS we have this:
``` javascript
var n = 0;
n.length === undefined;
false.length === undefined;
true.length === undefined;
NaN.length === undefined;

// There is an exception here:
undefined.length; // crash
```

And with the actual jQuery, sometime we have to do this:
``` javascript
if (obj)
    $.each(obj, function() {
        // ...
    });
```

If we reorder few instructions in the `$.each` function (without more bytes) we can remove the necessity of the `if` above.

Are you agree?
